import * as types from "../types";
import moment from "moment";
const initalState = {
  Name: "",
  SSID: "",
  BirdDay: moment().format("MMM Do YY"),
  PostId: "",
  post: {},
  loadding: false,
  error: null,
};
export const postReducer = (state = initalState, action) => {
  switch (action.type) {
    case types.UPDATE_NAME:
      return {
        ...state,
        Name: action.payload,
        SSID: action.ssid,
        PostId: action.post,
        BirdDay: moment(action.bird).format("MMM Do YY"),
        loading: false,
        error: null,
      };
    case types.UPDATE_SSID:
      return {
        ...state,
        SSID: action.payload
      };
    case types.UPDATE_BIRD:
      return {
        ...state,
        BirdDay: moment(action.payload).format("MMM Do YY"),
      };
    case types.UPDATE_POST:
      return {
        ...state,
        PostId: action.payload
      };
    default:
      return state;
  }
};
